// src/AboutCard.js
import React from 'react';
import './Abouttable.css';

// Dummy data placeholder. Replace with array of actual data objects
const data = [
    {
      project: "Project X",
      stack: ["react", "express", "node"],
      description:
        "Some sample text giving project elevator pitch and blah blah and other stuff and goals and dreams and rainbows and butterflies and sunshine. ",
      website: "https://www.google.com",
      github: "https://www.github.com",
      image:
        "https://s3-us-west-2.amazonaws.com/s.cdpn.io/326643/Sample%20Logo.png",
      needs: "People with super powers",
      status: "In Development"
    },
    {
      project: "Project XYZ",
      stack: ["python", "django"],
      description:
        "Some sample text giving project elevator pitch and blah blah and other stuff and goals and dreams and rainbows and butterflies and sunshine. ",
      website: "https://www.google.com",
      github: "https://www.github.com",
      needs: "People with super powers, semi-super powers, or no powers at all",
      image:
        "https://s3-us-west-2.amazonaws.com/s.cdpn.io/326643/sample%20logo%202.png",
      status: "Live"
    },
    {
      project: "Project X",
      stack: ["react", "express", "node"],
      description:
        "Some sample text giving project elevator pitch and blah blah and other stuff and goals and dreams and rainbows and butterflies and sunshine. ",
      website: "https://www.google.com",
      github: "https://www.github.com",
      image:
        "https://s3-us-west-2.amazonaws.com/s.cdpn.io/326643/Sample%20Logo.png",
      needs: "People with super powers",
      status: "In Development"
    },
    {
      project: "Project XYZ",
      stack: ["python", "django"],
      description:
        "Some sample text giving project elevator pitch and blah blah and other stuff and goals and dreams and rainbows and butterflies and sunshine. ",
      website: "https://www.google.com",
      github: "https://www.github.com",
      needs: "People with super powers, semi-super powers, or no powers at all",
      image:
        "https://s3-us-west-2.amazonaws.com/s.cdpn.io/326643/sample%20logo%202.png",
      status: "Live"
    },
    {
      project: "Project X",
      stack: ["react", "express", "node"],
      description:
        "Some sample text giving project elevator pitch and blah blah and other stuff and goals and dreams and rainbows and butterflies and sunshine. ",
      website: "https://www.google.com",
      github: "https://www.github.com",
      image:
        "https://s3-us-west-2.amazonaws.com/s.cdpn.io/326643/Sample%20Logo.png",
      needs: "People with super powers",
      status: "In Development"
    },
    {
      project: "Project XYZ",
      stack: ["python", "django"],
      description:
        "Some sample text giving project elevator pitch and blah blah and other stuff and goals and dreams and rainbows and butterflies and sunshine. ",
      website: "https://www.google.com",
      github: "https://www.github.com",
      needs: "People with super powers, semi-super powers, or no powers at all",
      image:
        "https://s3-us-west-2.amazonaws.com/s.cdpn.io/326643/sample%20logo%202.png",
      status: "Live"
    }
  ];

const Layout = ({ children }) => {
  return <div className="card-container">{children}</div>;
};

const Card = ({
  data: { status, description, needs, project, image, stack, website, github }
}) => {
  return (
    <div className="card-item">
      <div className="card">
        <div className="card-image">
          <img src={image} alt={project} />
        </div>
        <div className="card-content">
          <div>
            <StackIcons data={stack} />
          </div>
          <span className="card-title">
            {project}
          </span>
          <div>
            <span>
              <a href={website} target="_blank" rel="noopener noreferrer">Website</a>
            </span>
            <span>
              <a className="github" href={github} target="_blank" rel="noopener noreferrer">
                Github
              </a>
            </span>
          </div>
        </div>
        <div className="card-reveal">
          <span className="card-title">
            {project}
            <i className="material-icons right">close</i>
          </span>
          <div>
            <span className="status">{status}</span>
          </div>
          <p>{description}</p>
          <p>
            <strong>Need:</strong>
          </p>
          <p>{needs}</p>
        </div>
      </div>
    </div>
  );
};

const StackIcons = ({ data }) => {
  return (
    <div>
      {data.map((item) => (
        <div key={item} className="icon">
          <span className={item}>
            <span />
          </span>
        </div>
      ))}
    </div>
  );
};

const Projects = ({ data }) => {
  return data.map((item, idx) => <Card key={idx} data={item} />);
};

const AboutCard = () => (
  <Layout>
    <Projects data={data} />
  </Layout>
);

ReactDOM.createRoot(document.getElementById("root")).render(<AboutCard />);

export default AboutCard;
